f4429991-1013-47b8-8b89-0af2502ebf50	b3cf36b9-ae78-4bd2-8894-a1e3fe909b77	data:image/jpeg;base64,	Open Labs	In our open labs students work with instructors to pursue whatever field of programming interests them. With options ranging from learning the basics with scratch to making a game in unity, our labs are a great choice for anyone interested in coding, regardless of prior experience. Student to instructor ratio is at most 4:1. Available for ages 6 and up.	t	t
